def determine_lara_position(n, m, k):
    if k < n - 1:
        return (1 + k, 1)
    else:
        now = [n, 2]
        k -= n
        loop = k // (2 * (m - 1))
        now = [n - 2 * loop, 2]
        k %= 2 * (m - 1)
        if k <= m - 2:
            now[1] += k
        elif k <= m - 1:
            now[0] -= 1
            now[1] = m
        else:
            now[0] -= 1
            now[1] = m - (k - m + 1)
        return tuple(now)

